; buffCompute  1 值*敌军数量/我军数量     2 值*战法数量
; armyTypes 增减伤害指定兵种  1 骑兵   2 步兵   4 弓兵
; shareEffectTimeStates 共享剩余次数
; effectOnNegative 混乱暴走怯战犹豫状态下生效

